import PriceModel from '../models/PriceModel';

function View(props){
    const [priceModelVis , setPriceModelVis] = useState(false) ; 

    return (
        <td className="col view">
            <a href ="#" onClick={(event)=>{event.preventDefault() ; setPriceModelVis(true)}} className={priceModelVis?non-clickable:clickable}>View Pricing</a>
            {priceModelVis && <PriceModel handleVisiblity= {setPriceModelVis}/>}
        </td>
    )
}

export default View ;
